import React, { Component } from 'react';
import './../css/App.css';

class App extends Component {

  constructor () {
    super();

    this.rsTitle = "RedeSocial";
  }

  render() {
    return (
      <div className="App">
        <header id="header">
          <h1 id="rsTitle">{ this.rsTitle }</h1>
        </header>
      </div>
    );
  }
}

export default App;
